import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faInstagram, faYelp } from "@fortawesome/free-brands-svg-icons";
import "./footer.css";

function FooterBar() {
	return (
		<div className="footer">
			<div className="media">
				<a href="https://www.google.com/maps/dir//Central+Fish+Market/data=!4m8!4m7!1m0!1m5!1m1!1s0x88541f89902aac3f:0x99b0ae0815e748b2!2m2!1d-80.781706!2d35.215917">
					<i className="fas fa-map-marker-alt"></i>
				</a>
				<a href="facebook.com">
					<FontAwesomeIcon icon={faFacebook} size="2x" />
				</a>
				<a href="instagram.com">
					<FontAwesomeIcon icon={faInstagram} size="2x" />
				</a>
				<a href="yelp.com">
					<FontAwesomeIcon icon={faYelp} size="2x" />
				</a>
			</div>
			<div>Central Fish Market Â© 2021. All Rights Reserved.</div>
		</div>
	);
}
export default FooterBar;
